CREATE TABLE `tbl_transaksi_cacat` (
  `id_transaksi_cacat` bigint NOT NULL AUTO_INCREMENT,
  `order_cacat_id` bigint NOT NULL,
  `bank_id` bigint DEFAULT NULL,
  `payment_id` bigint DEFAULT NULL,
  `kode_transaksi` text,
  `terbayar` double DEFAULT '0' COMMENT 'Nominal Customer Membayar',
